import React from "react";
import "./OrderTracking.css";
import { MapContainer, TileLayer, Marker, Popup, Polyline } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";

const pickupIcon = new L.Icon({
    iconUrl: "https://cdn-icons-png.flaticon.com/512/263/263115.png",
    iconSize: [40, 40],
    iconAnchor: [20, 40],
  });

  const dropoffIcon = new L.Icon({
    iconUrl: "https://cdn-icons-png.flaticon.com/512/535/535137.png",
    iconSize: [40, 40],
    iconAnchor: [20, 40],
  });


function OrderTracking() {
    const pickupLocation = [37.7749, -122.4194]; // Example: San Francisco
    const dropoffLocation = [37.7849, -122.4094]; // Example: Nearby dropoff


  return (
    <div className="order-tracking-page">
      <header className="order-header">
        <h1>🚀 Your Order Has Been Submitted!</h1>
        <p>Track your delivery below</p>
      </header>

      <div className="order-container">
        {/* Left Panel */}
        <div className="order-details">
          <h2>📦 Order #123456789</h2>
          <p><strong>Pickup Time:</strong> 12:25 PM</p>
          <p><strong>Estimated Dropoff:</strong> 12:50 PM</p>

          <hr />


          <h3>👤 Customer</h3>
          <p>John Doe</p>
          <p>📞 +1 888-888-8888</p>

          <hr />

          <h3>🚗 Dasher</h3>
          <p>Mike D.</p>
          <p>📞 +1 888-888-9999</p>
          <p className="dasher-note">* Please contact the dasher using the same phone number used for ordering.</p>

          <hr />

          <h3>🛒 Order Details</h3>
          <p>2 items • $17.94 subtotal</p>

          <button className="contact-support">📞 Contact Support</button>
        </div>

        {/* Right Panel (Live Map) */}
        <div className="order-map">
          <div className="status-box">
            <h2>On the way to customer</h2>
            <p>Your order was picked up at 12:25 PM.</p>
          </div>

          {/* ✅ Leaflet Map */}
          <MapContainer center={pickupLocation} zoom={13} className="map">
            <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />

            {/* Pickup Marker */}
            <Marker position={pickupLocation} icon={pickupIcon}>
              <Popup>📍 Pickup Location</Popup>
            </Marker>

            {/* Dropoff Marker */}
            <Marker position={dropoffLocation} icon={dropoffIcon}>
              <Popup>🏠 Dropoff Location</Popup>
            </Marker>

            {/* Route from Pickup to Dropoff */}
            <Polyline positions={[pickupLocation, dropoffLocation]} color="blue" />
          </MapContainer>

          <div className="eta-box">
            <h3>📍 Dropoff ETA</h3>
            <p>12:54 PM</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default OrderTracking;
